    items: DSList(length=20, elem_type=Item),
    item_box_assignments: DSList(length=20, elem_type=BoxAssignment),
    x_y_positions: DSList(length=20, elem_type=BoxAssignment)
):
    # Ensure each item fits within the box dimensions
    for i in range(1, N_ITEMS + 1):
        assert items[i].width + x_y_positions[i].x <= BOX_WIDTH
        assert items[i].height + x_y_positions[i].y <= BOX_HEIGHT

        # Ensure item is assigned to a valid box
        assert item_box_assignments[i].box_id >= 1
        assert item_box_assignments[i].box_id <= 20

        # Ensure positions are within box boundaries
        assert x_y_positions[i].x >= 0
        assert x_y_positions[i].y >= 0
        assert x_y_positions[i].x <= BOX_WIDTH
        assert x_y_positions[i].y <= BOX_HEIGHT

        # Link item assignment to position
        assert item_box_assignments[i].box_id == x_y_positions[i].box_id
        assert item_box_assignments[i].x == x_y_positions[i].x
        assert item_box_assignments[i].y == x_y_positions[i].y

